import { Link } from "react-router-dom";
import db from "../Database";
import "../index.css"
function Dashboard() {
    const courses = db.courses;
    return (
        <div>
            <h1>Dashboard</h1>
            <div className="list-group">
                {courses.map((course) => (
                    <Link key={course._id} to={`/Kanbas/Courses/${course._id}`}
                          className="card wd-dashboard-padding">
                        <img className="card-img-top" src="../../n.png">
                            <div className="card-body">CS1210 </div> </img>
                    </Link>
                ))}
            </div>
        </div>
    );
}
export default Dashboard;
